> Entertainment Cory Wells, Three Dog Night singer, dies in New York at 74 This June 2014 photo provided by Three Dog Night shows, band members, Cory Wells, from left, Paul Kingery, Michael Allsup, Danny Hutton, and Pat Bautz of the music group, Three Dog Night, posing for a portrait, in Las Vegas. Wells, a founding member of the popular 1970s band and lead singer on such hits as "Never Been to Spain" and "Mama Told Me (Not to Come)," has died at age 74. Wells experienced acute back pain weeks ago and died suddenly Tuesday, Oct. 20, 2015, in Dunkirk, where he had lived, bandmate Hutton said. (Steve Spatafore/Three Dog Night via AP) 
